import Main from "../App/Pages/Main";
import TitlePAge from "../App/Pages/TitlePage";
import UserPage from "../App/Pages/UserPage";
import TabVersion from "../App/TabVersion";



export default [
    {
      name: 'app',
      url:"/",
      component: null,
      redirectTo: "app.main",
    },
    {
      name: 'app.main',
      url:"main",
      component: null,
    },
    {
      name: 'app.categories',
      url:"categories",
      component: null,
    },
    {
      name: 'app.settings',
      url:"settings",
      component: null,
    }
  ]
